/*Table structure for table `wy_property_paid_order` */

DROP TABLE IF EXISTS `wy_property_paid_order`;

CREATE TABLE `wy_property_paid_order` (
  `order_id` varchar(64) NOT NULL COMMENT '订单id',
  `channel` varchar(10) NOT NULL COMMENT '支付渠道',
  `fee` int(30) NOT NULL COMMENT '支付金额，单位分',
  `prepay_id` varchar(64) DEFAULT NULL COMMENT '预支付id',
  `transaction_id` varchar(64) DEFAULT NULL COMMENT '支付订单id',
  `result_code` varchar(32) DEFAULT NULL COMMENT '最终支付结果（成功，失败）',
  `err_code` varchar(128) DEFAULT NULL COMMENT '错误代码',
  `err_code_des` varchar(300) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `completed_time` datetime DEFAULT NULL COMMENT '完成时间',
  `notify_letian` int(1) DEFAULT '0' COMMENT '是否已经通知乐天，0-未通知，1-已通知',
  `user_id` bigint(20) NOT NULL,
  `pay_desc` varchar(500) DEFAULT NULL,
  `letian_room_id` varchar(100) NOT NULL COMMENT '乐天房间id',
  `letian_room_name` varchar(200) DEFAULT NULL COMMENT '乐天房间名称',
  `letian_xiaoqu_name` varchar(100) NOT NULL,
  `letian_id` varchar(20) DEFAULT NULL COMMENT '乐天小区id',
  `trade_state` varchar(40) DEFAULT NULL COMMENT '交易状态（在result_code success有值)',
  PRIMARY KEY (`order_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

